import whiteLogo from '../images/tinder_logo_white.png'
import colorLogo from '../images/tinder_logo.png'

const Nav = ({minimal}) => {

    return (
        <nav>
            <div className="logo-container">
                <img className="logo" src={minimal ? colorLogo : whiteLogo}/>
            </div>
        </nav>
    )
}

export default Nav
